  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes noxious weed control
  on Malheur National Wildlife Refuge in 2005.  Between April and November 2,385.5
  acres were treated for Perennial Pepperweed and Canada thistle. Seven acres were
  treated for Medusahead and 2.5 acres were treated for Knapweed. The average cost
  per acre was $30.  Pictures, maps, and a cost analysis are also provided in the
  report.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
